- input: "TEXT\x1CC00031088\x1C1\x1C\x1CF3XA\x1CNo employee whose salary appears on
    schedule H4 spent more than 25 percent of their time on FEA. The committee refunded
    the excessive donation by Rufus Lumry on 9/15/2010. This is reflected on the committees
    October 2010 FEC report. The committee has updated their disbursement to Friends
    of Dave Reichert to clarify the contribution as being for the General 2010 election
    cycle. The committee mistakenly listed a transfer of 43,920.85 on their previous
    September 2010 FEC report. This transfer was between two state bank accounts and
    involved no federal bank accounts. The Committee has updated their report to show
    the inkind received from the Republican National Committee correctly. The negative
    entry for this transaction listed on the previous September FEC report has been
    removed.\n"
